frontApp.controller("menuMainController",["$scope","$http","$window","CategoryPost","CategoryProduct",function(n,t,i,r,u){n.desSanPham=[];n.desBaoDuongXe=[];n.desLaiXeAnToan=[];n.desDaiLy=[];n.listSanPham=[];n.listSanPham2=[];n.listBaoDuongXe=[];n.listLaiXeAnToan=[];n.listDaiLy=[];t.get("/API/CategoryProductsAPI/").success(function(t){var i=u.getallCategory(t);angular.forEach(i,function(t){(t.alias=="dau-nhot-o-to"||t.alias=="dau-nhot-xe-tai"||t.alias=="dau-nhot-cong-nghiep")&&n.listSanPham.push(t)})});t.get("/API/ProductsAPI/").success(function(t){angular.forEach(t,function(t){t.feature==1&&n.desSanPham.push(t)})});t.get("/API/CategoriesAPI/").success(function(t){var i=r.getallCategory(t);angular.forEach(i,function(t){(t.alias=="khuyen-mai"||t.alias=="bao-hanh"||t.alias=="cau-hoi-thuong-gap")&&n.listSanPham2.push(t);t.idCategoryParent=="141"&&n.listBaoDuongXe.push(t);t.idCategoryParent=="142"&&n.listLaiXeAnToan.push(t);t.idCategoryParent=="143"&&n.listDaiLy.push(t)})});t.get("/API/PostsAPI/").success(function(t){angular.forEach(t,function(t){t.idCategory=="141"&&t.featured=="1"&&n.desBaoDuongXe.push(t);t.idCategory=="142"&&t.featured=="1"&&n.desLaiXeAnToan.push(t);t.idCategory=="143"&&t.featured=="1"&&n.desDaiLy.push(t)})})}]);